import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Pages/Home";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={Home} />
        </Routes>
        <Routes>
          <Route exact path="/user" component={Home} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
